import { Dialog, DialogTitle, IconButton } from "@mui/material";

function SubscribePopup ({username, nickname, type, showSubscribePopup, setShowSubscribePopup}){

    return(
    <div>
        <Dialog
        open={showSubscribePopup}
        onClose={() => setShowSubscribePopup(false)}
        >
            <DialogTitle>
                Prova
            </DialogTitle>
            <IconButton onClick={() => setShowSubscribePopup(false)}>
                Chiudi
            </IconButton>
        </Dialog>
    </div>
    )
}

export default SubscribePopup;
